import React, { Fragment } from "react";
import { Row, Col, Icon, Card, Avatar } from "antd";
const { Meta } = Card;

const ListCard = ({ data, handleDelete, onEdit }) => {
  return (
    <Fragment>
      <Row>
        {data.map(order => (
          <Col key={order.id} span={6}>
            <Card
              style={{
                width: "300px",
                margin: "2 0"
              }}
              key={order.id}
              title={`Table ${order.table_number}`}
              cover={<img alt="" src={order.url} />}
              actions={[
                <Icon type="delete" onClick={() => handleDelete(order.id)} />,
                <Icon type="edit" onClick={() => onEdit(order)} />
              ]}
            >
              <Meta
                avatar={<Avatar>{order.name}</Avatar>}
                title={`Customer: ${order.name}`}
                description={`Orders:${order.order}`}
              />
            </Card>
          </Col>
        ))}
      </Row>
    </Fragment>
  );
};

export default ListCard;
